import ReactQuill from "react-quill";
import "bootstrap/dist/css/bootstrap.css";
import 'react-quill/dist/quill.snow.css';

export default function CreatePost(){
    return(
        <form>
              <div class="form-group">
              <label >Title</label>
             <input style={{'margin-top': '100px'}} type="text" class="form-control" placeholder={'Title'} />
             </div>
            {/* <input style={{'margin-top': '200px'}} type="title" placeholder={'Title'}/> */}
            <div className="form-group">
                <label>Summary</label>
            <input className="form-control" type="summary" placeholder={'Summary'}/>
            </div>
            <input type='file' />
            <ReactQuill />
            <button type="submit" class="btn btn-dark">Publish</button>
        </form>

    )
}
